import React, {useState, useEffect} from 'react'
import './Buttons.css'
import {useNavigate} from 'react-router-dom'

function Buttons() {
  const navigate = useNavigate();
  const [password, setPassword] = useState('');
  const [state,setstate] = useState(0);

  useEffect(()=>{
    const generatePassword = () => {
      const length = 20; // length of the generated password
      const characters = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!@#$%^&*()_+~`|}{[]\:;?><,./-=';
      let newPassword = '';
  
      for (let i = 0; i < length; i++) {
        const randomIndex = Math.floor(Math.random() * characters.length);
        newPassword += characters[randomIndex];
      }
  
      setPassword(newPassword);
    };
    generatePassword();
  },[state])

  const navigateTo1 = () => {
    navigate("/Addbasicdetailsadmin",{send:{pass:"password"}});
  };
  const navigateTo2 = () => {
    navigate("/Search");
  };
  const navigateTo3 = () => {
    navigate("/Searchall");
  };
  const navigateTo4 = () => {
    navigate("/Addbasicdetailsemployee");
  };
  const navigateTo5 = () => {
    navigate("/Search1");
  };
  const navigateTo6 = () => {
    navigate("/Searchall1");
  };
  const navigateTo7 = () => {
    navigate("/Showsalary");
  };
  return (
    <div id='buttons'>
        <h3>Options</h3>
        <div className='buttons'>
            <button className='btn' onClick={navigateTo1} onChange={()=>{setstate(state+1)}}>Add New Admin</button>
            <button className='btn' onClick={navigateTo2}>Search Admin</button>
            <button className='btn' onClick={navigateTo3}>Show all Admin</button>
            <button className='btn' onClick={navigateTo4}>Add New Employee</button>
            <button className='btn' onClick={navigateTo5}>Search Employee</button>
            <button className='btn' onClick={navigateTo6}>Show all Employees</button>
            <button className='btn' onClick={navigateTo7}>Show Salary</button>
        </div>
    </div>
  )
}

export default Buttons
